import React, { useEffect, useState } from 'react';
import  useWebSocket, {ReadyState } from 'react-use-websocket';

const TagReceiver = () => {
  const [tag, setTag] = useState('');

  const { lastJsonMessage, readyState } = useWebSocket('ws://localhost:8082', {
    onOpen: () => console.log('Conectado ao servidor WebSocket'),
    onError: (event) => console.error(event),
    shouldReconnect: (closeEvent) => true,
    reconnectInterval: 3000,
  });

  useEffect(() => {
    console.log(readyState);
    if (readyState === ReadyState.OPEN && lastJsonMessage && lastJsonMessage.tag) {
      setTag(lastJsonMessage.tag);
    }
    console.log(lastJsonMessage);
  }, [readyState, lastJsonMessage]);

  return (
    <div>
      <h1>Tag RFID Atual: {tag}</h1>
    </div>
  );
};

export default TagReceiver;
